// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Validator {
    address admin;
    address exContract;
    uint wt;
    uint lt;

    constructor(address _exContract, uint _wt, uint _lt){
        admin = msg.sender;
        exContract = _exContract;
        wt = _wt;
        lt = _lt;
    }

    modifier onlyAdmin() {
    require(admin == msg.sender, "A1" );
    _;
    }

    modifier onlyExcontract() {
    require(exContract == msg.sender, "E1" );
    _;
    }

    function getValidatorAddres() external view onlyAdmin returns (address){
        return address(this);
    }  

    function updateAdmin(address _admin) external onlyAdmin{
        admin = _admin;
    }

    function updateExContract(address _excontract) external onlyAdmin{
        exContract = _excontract;
    }

    function updateValidation(uint _wt, uint _lt) external onlyAdmin {
        wt = _wt;
        lt = _lt;
    }    

    function validateW(address _sender, uint _mNonce, uint _diff, uint _tId, uint _t1s, uint _t2s) external view onlyExcontract returns (bytes32) {
        return keccak256(abi.encodePacked(_sender, wt, _mNonce, _diff, _tId, _t1s, _t2s));
    }

    function validateL(address _sender, uint _mNonce, uint _diff, uint _tId, uint _t1s, uint _t2s) external view onlyExcontract returns (bytes32) {
        return keccak256(abi.encodePacked(_sender, lt, _mNonce, _diff, _tId, _t1s, _t2s));
    }
}
